CREATE DEFINER=`root`@`localhost` PROCEDURE `checkDetails` (IN `P_name` VARCHAR(25), IN `P_middle` VARCHAR(25), IN `P_last` VARCHAR(25), IN `P_address` VARCHAR(25), IN `P_age` INT, IN `P_gender` VARCHAR(25), IN `P_illness` VARCHAR(25), IN `P_date` DATE, IN `P_status` VARCHAR(25), IN `P_second_status` DATE)  NO SQL
BEGIN
SELECT 
patient_details.id AS details_ID
FROM `patient_profile` 
INNER JOIN `patient_details`    
ON patient_details.P_id = patient_profile.id 
WHERE
patient_profile.name = P_name AND 
patient_profile.middle = P_middle AND 
patient_profile.last = P_last AND 
patient_profile.address = P_address AND 
patient_profile.age = P_age AND 
patient_profile.gender=P_gender AND 
