patient_details.date = P_date AND 
patient_details.status = P_status AND 
patient_details.second_status <=> P_second_status;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `checkIllness` (IN `P_illness` VARCHAR(25))  NO SQL
BEGIN

SELECT id FROM `illness_desc` WHERE illness_desc.illness_type LIKE CONCAT('%', P_illness , '%');
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `checkPatient` (IN `P_name` VARCHAR(25), IN `P_middle` VARCHAR(25), IN `P_last` VARCHAR(25), IN `P_age` INT)  NO SQL
BEGIN
