patient_profile.name=P_name AND patient_profile.middle=P_middle AND patient_profile.last=P_last AND 
patient_profile.age=P_age;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `checkUsers` (IN `P_email` VARCHAR(25))  NO SQL
BEGIN
