INSERT INTO `illness_desc` (`id`, `illness_type`, `description`, `actions`) VALUES
(1, 'DENGUE', NULL, 'Request Fogging to San Pablo City Health Office'),
(2, 'Measle', 'an acute viral respiratory illness. It is characterized by a prodrome of fever (as high as 105°F) and malaise, cough, coryza, and conjunctivitis -the three “C”s -, a pathognomonic enanthema (Koplik spots) followed by a maculopapular rash .', 'Encourage parents and guardians to get their children vaccinated against measles in response to the outbreak.'),
(3, 'Tuberculosis', 'a disease caused by germs that are spread from person to person through the air. TB usually affects the lungs, but it can also affect other parts of the body, such as the brain, the kidneys, or the spine. A person with TB can die if they do not get treatment', 'Please Provide TB education and screening on Brgy'),
(4, 'Leptospirosis', 's a bacterial disease that affects humans and animals. It is caused by bacteria of the genus Leptospira. In humans, it can cause a wide range of symptoms, some of which may be mistaken for other diseases. Some infected persons, however, may have no symptoms at all.', 'Please inform the official if the underground pipes has no leakage and start educating the community about the danger of Contaminated Water.'),
(5, 'Chikungunya', 'Chikungunya virus is spread to people by the bite of an infected mosquito. The most common symptoms of infection are fever and joint pain. Other symptoms may include headache, muscle pain, joint swelling, or rash. Outbreaks have occurred in countries in Africa, Asia, Europe, and the Indian and Pacific Oceans.', 'Request Fogging to San Pablo City Health Office'),
(6, 'Chickenpox', 'Chickenpox is an infection caused by the varicella-zoster virus. It causes an itchy rash with small, fluid-filled blisters. Chickenpox is highly contagious to people who haven\'t had the disease or been vaccinated against it.', 'Encourage parents and guardians to get their children vaccinated against measles in response to the outbreak.'),
(7, 'Malaria', 'Malaria is a serious and sometimes fatal disease caused by a parasite that commonly infects a certain type of mosquito which feeds on humans. People who get malaria are typically very sick with high fevers, shaking chills, and flu-like illness. Four kinds of malaria parasites infect humans: Plasmodium falciparum, P. vivax, P. ovale, and P. malariae. In addition, P. knowlesi, a type of malaria that naturally infects macaques in Southeast Asia.\r\n', 'Request Fogging to San Pablo City Health Office'),
(8, 'Flu', 'Flu is a contagious respiratory illness caused by influenza viruses that infect the nose, throat, and sometimes the lungs. It can cause mild to severe illness, and at times can lead to death. The best way to prevent flu is by getting a flu vaccine each year.', '\nEncourage parents and guardians to get their children vaccinated against Flu in response to the outbreak.'),
(9, 'Rabies', 'Rabies is a preventable viral disease most often transmitted through the bite of a rabid animal. The rabies virus infects the central nervous system of mammals, ultimately causing disease in the brain and death.', 'Please encourage pet owners to vaccinate their Pets and suggest a Rabies vaccine if they commonly travel '),
(10, 'Diphtheria', 'Diphtheria is a serious infection caused by strains of bacteria called Corynebacterium diphtheriae that make toxin (poison). It can lead to difficulty breathing, heart failure, paralysis, and even death. CDC recommends vaccines for infants, children, teens, and adults to prevent diphtheria.', 'Please Encourage parents to get their child a vaccine'),
(14, 'CHIKUNGGUNIA', NULL, '	Request Fogging to San Pablo City Health Office'),
(15, 'LEPTHOSPAIROSIS', NULL, NULL);
